import "./style.css";
import trash from "../../assets/trash.svg";

export const Card = ({ expense }) => {
  console.log(expense);
  return (
    <ul>
      {expense.map((element) => {
        console.log(element.value);
        return (
          <li className="lista">
            <div className="ml-card">
              <p className="title-card ">Description</p>
              <span className="span-card">Entrada</span>
            </div>
            <div className="width-card flex-card">
              <span className="span-card">R$ 6000,00</span>
              <button className="button-trash">
                <img src={trash} alt="trash" />
              </button>
            </div>
          </li>
        );
      })}
    </ul>
  );
};
